      className="image"
      src={props.src}
      alt="Image of paper booklet"
      style={{ height: "15em", width: "auto" }}
    />
    <h1 style={{ paddingTop: "5px" }} className="title is-6">
      {props.title}
    </h1>
  </div>
);

export default ResourceBookLayout;
